import { Outlet } from 'react-router-dom';
import './assets/css/style.css';
import MenuTop from './layouts/menutop';

const Layout=()=>
    {
        return (
            <body>
                <header class="header">

                    <div class="main_container">
                    <MenuTop/>
                    </div>






                </header>

                <div class="news-home">
                    <div class="container_main" style={{minHeight:500}} >
                    <Outlet/>
                    </div>
                </div>
    

            </body>

        );
    };

export default Layout;
